import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import About from './pages/aboutpage';
import Home from './pages/homepage';
import Contact from './pages/contactpage';
import Seminars from './pages/seminarspage';
import Login from './pages/login';
import Register from './pages/register';

function App() {
  return (
    // <BrowserRouter>
      <Routes>
        <Route path='/' elsement={<Home />}></Route>
        <Route path='/about' elsement={<About />}></Route>
        <Route path='/contact' elsement={<Contact />}></Route>
        <Route path='/seminars' elsement={<Seminars />}></Route>
        <Route path='/login' elsement={<Login />  }></Route>
        <Route path='/register' elsement={<Register />  }></Route>
      </Routes>
    // </BrowserRouter>
  );
}

export default App;
